import React from "react";
import  ReactDOM  from "react-dom";


function MyApp(){
    return(
    <div>
        <ul>
            <li>Name</li>
            <li>Age</li>
            <li>Salary</li>
        </ul>
    </div>
    )
}
ReactDOM.render(
    <MyApp/>
   , document.getElementById('root')
)
